import React from "react";

const ImageComponent = (props) => {
  return (
    <div>
      <p>{props.data.id}</p>
      <p>{props.data.name}</p>
      <img src={props.data.img}></img>
      <p>like{props.data.like === 0 ? 0 : props.data.like}</p>
      <p>dislike{props.data.dislike}</p>
    </div>
  );
};

export default ImageComponent;
